%[text] # photometric attitude estimation using Cubature Klamn filter (quaternion only)
%[text] UKFでlight curve attitude estimation
%[text] ## state variables
%[text] ${\\bf x}=\[{\\bf q}^T, {\\bf \\omega}^T\]^T$
%[text] `q`: quaternion where q(4) is the scalar part 
%[text] `w`: angular rate, rad/s
%[text] ## note
%[text] NA
%[text] ## references 
%[text] NA
%[text] ## revisions
%[text] 20220805 y.yoshimura, minor changes
%[text] 20210209  y.yoshimura, y.yoshimula@gmail.com
%[text] See also orbitConst, mainAttiOrbit.
clc
clear
cls
%[text] ## constants
earthVSOP = vsopConst; % VSOP parameters
const = orbitConst; % constants for orbital motion
%%
%[text] ## simulation conditions
% true value calculated by mainAttiOrbit.mlx
fName = "flatPlate"; %[control:dropdown:73ba]{"position":[9,20]}
load(strcat(fName,'.mat'));

% random number generator
rng(2022,'twister');
%[text] ## observations and noise
tn_ = length(t_);

sigMapp = 0.1; %[control:editfield:9a36]{"position":[11,14]}
mAppNoise = mApp + sigMapp .* randn(tn_, 1);

% observations
dTmp = vecnorm(obsRel, 2, 2); % m, distance between sat and observer
% mAppInv = magInv(mAppNoise(:,1), dTmp); % true obs. (relative magnitude inverse)

% estimated observation noise (standard deviation)
sigEst = 3 * sigMapp;
Rest = sigEst.^2;
Qest = 1 * deg2rad(1e-6)^2 .* eye(3); % process noise

%%
%[text] ### pre-allocation
n_ = 3;
xEst = zeros(tn_, n_); % [error GRP]
p = zeros(tn_, n_); % diagonal components of covariance matrix (Pcov)
qGlobal = zeros(tn_, 4);
ye0 = 0;
yez = zeros(2*n_,1);
yeOut = zeros(tn_, 1);

%%
%[text] ## initial estiamte and covariance
qGlobal(1,:) = q(1,:);  % true initial
tmp = zyx2q(4, deg2rad(0), ... %[control:editfield:7491]{"position":[24,25]}
    deg2rad(20), ... %[control:editfield:7d2f]{"position":[13,15]}
    deg2rad(20)); % initial estimate error of quaternion %[control:editfield:09d6]{"position":[13,15]}
qGlobal(1,:) = qMult(4, 1, tmp, q(1,:));

%[text] #### initial covariance for 3$\\sigma\n$bound 
iniErr = deg2rad(40); %[control:editfield:1930]{"position":[18,20]}
p(1,:) = (iniErr * 3)^2 .* ones(1,3);
Pcov = diag(p(1,:));

% x:= error GRP
xEst(1,:) = zeros(1,n_);
%[text] ### Gneralized Rodrigues parameters
grp.a = 1;
grp.f = 2 * (grp.a + 1);
%%
%[text] ## CKF
for i = 1:tn_-1 %[output:group:5bb2c3d4]
    dt_ = t_(i+1) - t_(i);

    [xEst(i+1,:), qGlobal(i+1,:), Pcov] = lcCKF(jdHistory(i+1), dt_, xEst(i,:), Pcov, mAppNoise(i+1), ... %[output:79a8d448]
        Qest, Rest, grp, qGlobal(i,:), w(i,:), r(i+1,:), obsECI(i+1,:), sat, const, earthVSOP); %[output:79a8d448]

end %[output:group:5bb2c3d4]
%%
%[text] ## data handling
qe = qErr(4, q, qGlobal);
zyxE = q2zyx(4, qe);
phiE = zyxE(:,1);
thetaE = zyxE(:,2);
psiE = zyxE(:,3);

%[text] ## show figures
figure %[output:4ad74b16]
tiledlayout(4,1),nexttile %[output:4ad74b16]
plot(t_, qe(:,1), 'r') %[output:4ad74b16]
title('error quaternion') %[output:4ad74b16]
nexttile %[output:4ad74b16]
plot(t_, qe(:,2), 'g') %[output:4ad74b16]
nexttile %[output:4ad74b16]
plot(t_, qe(:,3), 'b') %[output:4ad74b16]
nexttile %[output:4ad74b16]
plot(t_, qe(:,4), 'k') %[output:4ad74b16]

figure %[output:616d99c4]
tiledlayout(3,1),nexttile %[output:616d99c4]
plot(t_/60, rad2deg(phiE), 'r') %[output:616d99c4]
title('Euler angle error [deg]') %[output:616d99c4]
xlim([0 60*6]),ylim([-60 60]) %[output:616d99c4]
nexttile %[output:616d99c4]
plot(t_/60, rad2deg(thetaE), 'g') %[output:616d99c4]
xlim([0 60*6]),ylim([-60 60]) %[output:616d99c4]
nexttile %[output:616d99c4]
plot(t_/60, rad2deg(psiE), 'b') %[output:616d99c4]
xlim([0 60*6]),ylim([-60 60]) %[output:616d99c4]



